"Herkenrode" Noctis — великолепный аббатский коричневый дюббель, обладатель многочисленных наград и представитель 23-х официальных монастырских сортов пива Бельгии. Для его изготовления применяется 100% мюнхенский ячменный солод и хмель разновидностей Штириан Голдинг и Ист Кент Голдинг. Выдержка в бочонках придала напитку легкий ванильно-дымный оттенок, а повторная ферментация в бутылке обеспечила отличную карбонизацию. Великолепное качество пива "Херкенроде" Ноктис отмечено такими наградами:
— два “золота” на конкурсе Monde Selection;
— титул “Лучшее бельгийское пиво” на WBA-2016;
— “бронза” на австралийском конкурсе AIBA-2017.
